import React from "react";
import Artist from "./Artist";
import Audience from "./Audience";
import Publisher from "./Publisher";
import Personal from "./Personal";
import { COLORS } from "./Colors";
import Logo from "../Assets/logo.png";
import contractMeta from "../Build/MusicMarketplace.json";

import { ethers } from 'ethers';
import { create } from 'ipfs-http-client';
import axios from 'axios';
import Loader from "react-loader-spinner";
import SwitchSelector from "react-switch-selector";

class Login extends React.Component {
 constructor(props) {
    super(props);
    this.provider = new ethers.providers.Web3Provider(window.ethereum);
    this.signer = this.provider.getSigner();
    this.contract = new ethers.Contract(contractMeta.address, contractMeta.abi, this.signer);
    this.state = { account: "", ipfs: "", username: "", type: "", choice: "1", };
 }

 componentDidMount() {
    this.loadBlockchain().then(() => console.log("Loaded Blockchain"));
    this.loadIPFS().then(() => console.log("Loaded IPFS"));
    this.loginUser().then(() => console.log("Login Successful"));
 }

 async loadBlockchain() {
    const accounts = await this.provider.listAccounts();
    this.setState({ account: accounts[0] });
 }

 async loadIPFS() {
    try {
      const JWT = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..oqfWb_f78GtF7VXqrrmNfbYP8UFzx6oVGvutjFLRh_g';
      const response = await axios.get('https://api.pinata.cloud/data/pinList', {
        headers: {
          'Authorization': `Bearer ${JWT}`
        }
      });
      const ipfsGatewayUrl = response.data.rows[0].ipfs_pin_hash;
      const conn = create({ host: ipfsGatewayUrl, port: '5001', protocol: 'https' });
      this.setState({ ipfs: conn });
    } catch (error) {
      console.error('Error loading IPFS:', error);
    }
 }

 loginUser = async () => {
    let val = "0";
    const contractInstance = this.contract;
    const userType = await contractInstance.checkUserType();
    val = userType.toString();
    this.setState({ type: val });
 }

 registerUser = async () => {
    const contractInstance = this.contract;
    switch (this.state.choice) {
      case "1": // Personal
        await contractInstance.addPersonal(this.state.username);
        break;
      case "2": // Publisher
        await contractInstance.addPublisher(this.state.username);
        break;
      case "3": // Artist
        await contractInstance.addArtist(this.state.username);
        break;
      case "4": // Commercial
        await contractInstance.addCommercial(this.state.username);
        break;
      default:
        console.error("Invalid choice for user type");
    }
    this.loginUser();
 }

